import React, { Component } from 'react';
import './vertical-middle.sass';

export default class VerticalMiddle extends Component {
  render() {
    return (
      <div className="vertical-middle">
        <div>
          <h1>middle</h1>
          <p>文字居中于div</p>
        </div>
      </div>
    );
  }
}
